import React from 'react';
import './App.css';
import Todolist from "./Todolist";

function App() {
    const todoListTitle_1: string = "What to learn"
    const todoListTitle_2: string = "What to byu";
    return (
        <div className="App">
            <Todolist title={todoListTitle_1}/>
            <Todolist title={todoListTitle_2}/>
        </div>
    );
}

export default App;
